// src/config/supabaseClient.js
import { createClient } from '@supabase/supabase-js';

// Sostituisci con le tue credenziali reali di Supabase
const supabaseUrl = process.env.REACT_APP_SUPABASE_URL || 'https://tua-project-url.supabase.co';
const supabaseAnonKey = process.env.REACT_APP_SUPABASE_ANON_KEY || 'tua-chiave-pubblica-supabase';

export const supabase = createClient(supabaseUrl, supabaseAnonKey);
